import React from "react";
import styled from "styled-components";

const arr = [
  { title: "미리보기", to: "/" },
  { title: "고객문의", to: "/" },
  { title: "공지사항", to: "/" },
  { title: "블로그", to: "/" },
];

const Wrapper = styled.header`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 64px;
  background-color: white;
`;
function Header() {
  return (
    <Wrapper>
      <figure>
        <img src="/assets/header/logo.svg" alt="moogchi" />
      </figure>
      <div className="right"></div>
    </Wrapper>
  );
}

export default Header;
